        "frequency": -2.7020250854548067e-05
    }
];


// Wait for the page to fully load before starting the animation
window.onload = function () {
    // Start the custom clock once the page has fully loaded
    let startTime = Date.now(); // Start the clock from now
    let lastScale = 1; // Initial scale
    let targetScale = 1; // Target scale (starts at 1)
    const maxScale = 3; // Maximum scale (text will not exceed this size)

    // Function to smoothly interpolate between two values
    function lerp(start, end, t) {
        return start + (end - start) * t;
    }

    function animateText() {
        // Get the current time elapsed
        const elapsedTime = (Date.now() - startTime) / 1000; // Time in seconds

        // Find the closest frequency data point to the current time
        const closestDataPoint = frequencyData.reduce((prev, curr) => {
            return Math.abs(curr.time - elapsedTime) < Math.abs(prev.time - elapsedTime) ? curr : prev;
        });

        // Pulse effect based on frequency (loudness)
        const frequency = closestDataPoint.frequency;

        // Apply bias to frequency to give vocals and high-pitched sounds more weight
        targetScale = 1 + Math.pow(frequency * 10, 1.5); // Adjust this factor for subtlety

        // Interpolate smoothly between lastScale and targetScale
        const scale = lerp(lastScale, targetScale, 0.1); // '0.1' is the smoothness factor

        // Ensure the scale doesn't exceed maxScale
        const finalScale = Math.min(scale, maxScale);

        // Apply the scale to the text element
        text.style.transform = `scale(${Math.max(1, finalScale)})`;

        // Update lastScale for the next frame
        lastScale = finalScale;

        // Continue the animation loop
        requestAnimationFrame(animateText);
    }

    // Start the animation once the page is fully loaded
    animateText();
};
</script>
